const Questions = [
    {
      text: "What is the capital of France?",
      options: [
        { id: 0, text: "London", isCorrect: false },
        { id: 1, text: "Paris", isCorrect: true },
        { id: 2, text: "Berlin", isCorrect: false },
        { id: 3, text: "Madrid", isCorrect: false },
      ],
    },
    {
      text: "Which planet is known as the Red Planet?",
      options: [
        { id: 0, text: "Jupiter", isCorrect: false },
        { id: 1, text: "Mars", isCorrect: true },
        { id: 2, text: "Venus", isCorrect: false },
        { id: 3, text: "Saturn", isCorrect: false },
      ],
    },
    {
      text: "Who painted the Mona Lisa?",
      options: [
        { id: 0, text: "Vincent van Gogh", isCorrect: false },
        { id: 1, text: "Leonardo da Vinci", isCorrect: true },
        { id: 2, text: "Pablo Picasso", isCorrect: false },
        { id: 3, text: "Michelangelo", isCorrect: false },
      ],
    },
  ];
  

export default Questions;
